import React, { useState } from "react";
import { Modal, Form, Button } from "react-bootstrap";

const VendorRegistration = () => {
  const [step, setStep] = useState(1); // Step tracker
  const [formData, setFormData] = useState({
    licenseState: "",
    licenseNumber: "",
    dispensaryType: "",
    businessAddress: {
      street: "",
      city: "",
      state: "",
      zip: "",
    },
    firstName: "",
    lastName: "",
    contactNumber: "",
    email: "",
    password: "",
  });

  const [showValidation, setShowValidation] = useState(false); // Validation toggle

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleNestedChange = (section, field, value) => {
    setFormData((prev) => ({
      ...prev,
      [section]: { ...prev[section], [field]: value },
    }));
  };

  const handleNextStep = () => setStep((prev) => prev + 1);
  const handlePrevStep = () => setStep((prev) => prev - 1);

  const handleSubmit = () => {
    alert("Vendor registration successful!");
    // Add your form submission logic here
  };

  return (
    <Modal show centered>
      <Modal.Header closeButton>
        <Modal.Title>{`Step ${step}/3`}</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        {/* Step 1: Dispensary Info */}
        {step === 1 && (
          <>
            <h5>Dispensary Info</h5>
            <Form.Group className="mb-3">
              <Form.Label>License</Form.Label>
              <div className="d-flex">
                <Form.Select
                  name="licenseState"
                  value={formData.licenseState}
                  onChange={handleChange}
                  required
                  style={{ width: "120px" }}
                >
                  <option value="">Select State</option>
                  <option value="CA">CA</option>
                  <option value="NV">NV</option>
                  {/* Add more states */}
                </Form.Select>
                <Form.Control
                  type="text"
                  placeholder="License Number"
                  name="licenseNumber"
                  value={formData.licenseNumber}
                  onChange={handleChange}
                  required
                  className="ms-3"
                />
              </div>
            </Form.Group>

            <Form.Group className="mb-3">
              <Form.Label>What service do you provide?</Form.Label>
              <Form.Select
                name="dispensaryType"
                value={formData.dispensaryType}
                onChange={handleChange}
                required
              >
                <option value="">Select a Service</option>
                <option value="Pickup">Pickup</option>
                <option value="Delivery">Delivery</option>
                <option value="Both">Pickup & Delivery</option>
              </Form.Select>
            </Form.Group>

            <Form.Group className="mb-3">
              <Form.Label>Business Address</Form.Label>
              <Form.Control
                type="text"
                placeholder="Street"
                value={formData.businessAddress.street}
                onChange={(e) =>
                  handleNestedChange("businessAddress", "street", e.target.value)
                }
              />
              <Form.Control
                type="text"
                placeholder="City"
                className="mt-2"
                value={formData.businessAddress.city}
                onChange={(e) =>
                  handleNestedChange("businessAddress", "city", e.target.value)
                }
              />
              <Form.Control
                type="text"
                placeholder="State"
                className="mt-2"
                value={formData.businessAddress.state}
                onChange={(e) =>
                  handleNestedChange("businessAddress", "state", e.target.value)
                }
              />
              <Form.Control
                type="text"
                placeholder="Zip Code"
                className="mt-2"
                value={formData.businessAddress.zip}
                onChange={(e) =>
                  handleNestedChange("businessAddress", "zip", e.target.value)
                }
              />
            </Form.Group>

            {showValidation && (
              <div className="text-danger">
                {!formData.licenseState && <p>License State is required.</p>}
                {!formData.licenseNumber && <p>License Number is required.</p>}
                {!formData.dispensaryType && <p>Dispensary Type is required.</p>}
                {(!formData.businessAddress.street ||
                  !formData.businessAddress.city ||
                  !formData.businessAddress.state ||
                  !formData.businessAddress.zip) && <p>Complete Business Address is required.</p>}
              </div>
            )}
          </>
        )}

{step === 2 && (
  <>
    <h5>Business Owner Details</h5>
    <div className="d-flex justify-content-between mb-3">
      <Form.Group className="me-2 flex-grow-1">
        <Form.Label>First Name</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter your first name"
          name="firstName"
          value={formData.firstName}
          onChange={handleChange}
        />
      </Form.Group>
      <Form.Group className="flex-grow-1">
        <Form.Label>Last Name</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter your last name"
          name="lastName"
          value={formData.lastName}
          onChange={handleChange}
        />
      </Form.Group>
    </div>

    <Form.Group className="mb-3">
      <Form.Label>Phone Number</Form.Label>
      <Form.Control
        type="tel"
        placeholder="Enter your phone number"
        name="contactNumber"
        value={formData.contactNumber}
        onChange={handleChange}
      />
    </Form.Group>

    <Form.Group className="mb-3">
      <Form.Label>Email</Form.Label>
      <Form.Control
        type="email"
        placeholder="Enter your email"
        name="email"
        value={formData.email}
        onChange={handleChange}
      />
    </Form.Group>

    <Form.Group className="mb-3">
      <Form.Label>Password</Form.Label>
      <Form.Control
        type="password"
        placeholder="Create a password"
        name="password"
        value={formData.password}
        onChange={handleChange}
      />
    </Form.Group>
  </>
)}


      </Modal.Body>
      <Modal.Footer>
        {step > 1 && (
          <Button variant="secondary" onClick={handlePrevStep}>
            Back
          </Button>
        )}
        {step < 3 && (
          <Button
            variant="primary"
            onClick={() => {
              if (
                (step === 1 &&
                  (!formData.licenseState ||
                    !formData.licenseNumber ||
                    !formData.dispensaryType ||
                    !formData.businessAddress.street ||
                    !formData.businessAddress.city ||
                    !formData.businessAddress.state ||
                    !formData.businessAddress.zip)) ||
                (step === 2 &&
                  (!formData.firstName ||
                    !formData.lastName ||
                    !/^\d{10}$/.test(formData.contactNumber) ||
                    !/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(formData.email) ||
                    formData.password.length < 8))
              ) {
                setShowValidation(true);
              } else {
                setShowValidation(false);
                handleNextStep();
              }
            }}
          >
            Next
          </Button>
        )}
        {step === 3 && (
          <Button variant="success" onClick={handleSubmit}>
            Register
          </Button>
        )}
      </Modal.Footer>
    </Modal>
  );
};

export default VendorRegistration;
